import React from 'react';
import { useJournal } from '../JournalContext';

const EntryList: React.FC = () => {
  const { entries, deleteEntry } = useJournal();

  return (
    <div>
      <h2>Entries</h2>
      <ul>
        {entries.map(entry => (
          <li key={entry.id}>
            <h3>{entry.title}</h3>
            <button onClick={() => deleteEntry(entry.id)}>Supprimer</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default EntryList;
